export const GetTrainerIdRange = function(winStreak:number){
  winStreak = Math.floor(winStreak);
  if (winStreak < 0)
    winStreak = 0;
  const challengeNum = Math.min(Math.floor(winStreak / 7), 7);
  const battleNum = winStreak % 7;

  if (challengeNum <= 7){
    if (battleNum == FRONTIER_STAGES_PER_CHALLENGE - 1)
      return sFrontierTrainerIdRangesHard[challengeNum];
    else
      return sFrontierTrainerIdRanges[challengeNum];
  } else {
    return sFrontierTrainerIdRanges[7];
  }
}

